import React from 'react'



import './map.scss'

import {GoogleMap, LoadScript, Polygon} from '@react-google-maps/api';

const containerStyle = {
    minWidth: '100vh',
    height: '100vh'
};

const center = {
    lat: 55.7522200,
    lng: 37.6155600,
};


const paths = [
    { lat: 25.774, lng: -80.19 },
    { lat: 18.466, lng: -66.118 },
    { lat: 32.321, lng: -64.757 },
    { lat: 25.774, lng: -80.19 }
]

const options = {
    fillColor: "lightblue",
    fillOpacity: 1,
    strokeColor: "red",
    strokeOpacity: 1,
    strokeWeight: 2,
    clickable: false,
    draggable: false,
    editable: false,
    geodesic: false,
    zIndex: 1
}

const onLoad = polygon => {
    console.log("polygon: ", polygon);
}

function MyMapComponent() {

    return  (
        <div className='map'>
            <LoadScript
                googleMapsApiKey="AIzaSyBYEey3dAT7X6YcANl4oNHBa5V-4KS2cGA"
            >
                <GoogleMap
                    center={center}
                    zoom={10}
                    mapContainerStyle={containerStyle}
                >
                    <Polygon
                        onLoad={onLoad}
                        paths={paths}
                        options={options}
                    />
                </GoogleMap>
            </LoadScript>
        </div>

    )
}

export default React.memo(MyMapComponent)
